import { useNavigate } from 'react-router-dom';
import React from 'react';

/*eslint-disable*/
const BotonSubmit = () => {

    
     function checkLogin() {
        const recogerCredenciales = 'http://localhost/Erroja/src/server/comprobarCredenciales.php';
        let username = document.getElementById("username").value;
        let password = document.getElementById("password").value;
    
    
        let credenciales = {
    
            username: username,
            password: password
    
        };
    
        let xhr = new XMLHttpRequest();
        xhr.addEventListener('readystatechange', checkLoginResponse);
        xhr.open('POST', recogerCredenciales, true);
        xhr.send(JSON.stringify(credenciales));
    
    }
    
    
     function checkLoginResponse(event) {
        if (event.target.readyState == 4 && event.target.status == 200) {
    
            let response = JSON.parse(event.target.responseText);
    
    
            if (response['auth'] == 1) {
                console.log("OK");
                console.log(response);
                navigate('/HomeProfesor')
    
    
    
    
    
    
    
    
            } else {
                console.log("NO");
            }
    
    
    
    
    
    
    
        }
    }






    const navigate = useNavigate();
    return (
        <button id='navegar' onClick={checkLogin}>Inciar Sesin</button>
    )
}

const LoginForm = () => {


    
    return   <form onSubmit={(event) => event.preventDefault()}>
    <h2>Inicia sesin</h2>
    <input required type="text" id="username" placeholder="Nombre de usuario" /><br/>
    <input required type="text" id="password" placeholder="Contrasea" /><br />
    <p><a>Olvidaste tu contrasea?</a></p>
    <div id="divboton">
    <BotonSubmit/>
    </div>
    </form>



}



export default LoginForm;
